/ @param _value The amount of tokens to be approved for transfer\\n    /// @return Whether the approval was successful or not\\n    function approve(address _spender, uint256 _value) public returns (bool success);\\n\\n    /// @param _owner The address of the account owning tokens\\n    /// @param _spender The address of the account able to transfer the tokens\\n    /// @return Amount of remaining tokens allowed to spent\\n    function allowance(address _owner, address _spender) public constant returns (uint256 remaining);\\n\\n    event Transfer(address indexed _from, address indexed _to, uint256 _value);\\n    event Approval(address indexed _owner, address indexed _spender, uint256 _value);\\n}\\n\",\"sourcePath\":\"/Users/james/spankchain/spankbank/contracts/Token.sol\",\"ast\":{\"absolutePath\":\"/Users/james/spankchain/spankbank/contracts/Token.sol\",\"exportedSymbols\":{\"Token\":[2971]},\"id\":2972,\"nodeType\":\"SourceUnit\",\"nodes\":[{\"id\":2907,\"literals\":[\"solidity\",\"0.4\",\".24\"],\"nodeType\":\"PragmaDirective\",\"src\":\"102:23:13\"},{\"baseContracts\":[],\"contractDependencies\":[],\"contractKind\":\"contract\",\"documentation\":null,\"fullyImplemented\":false,\"id\":2971,\"linearizedBaseContracts\":[2971],\"name\":\"Token\",\"nodeType\":\"ContractDefinition\",\"nodes\":[{\"constant\":false,\"id\":2909,\"name\":\"totalSupply\",\"nodeType\":\"VariableDeclaration\",\"scope\":2971,\"src\":\"609:26:13\",\"stateVariable\":true,\"storageLocation\":\"default\",\"typeDescriptions\":{\"typeIdentifier\":\"t_uint256\",\"typeString\":\"uint256\"},\"typeName\":{\"id\":2908,\"name\":\"uint256\",\"nodeType\":\"ElementaryTypeName\",\"src\":\"609:7:13\",\"typeDescriptions\":{\"typeIdentifier\":\"t_uint256\",\"typeString\":\"uint256\"}},\"value\":null,\"visibility\":\"public\"},{\"body\":null,\"documentation\":\"@param _owner The address from which the balance will be retrieved\\n @return The balance\",\"id\":2916,\"implemented\":false,\"isConstructor\":false,\"